import React from 'react'

const Header = () => {
  return (
    <div className='w-44 absolute  px-8 py-2 bg-gradient-to-t from-black z-10 w-screen 'flex>
        <img className='w-40 ' src='https://upload.wikimedia.org/wikipedia/commons/7/7a/Logonetflix.png'></img>
        <button className='bg-red-600 p-1'>Sign out</button>
        </div>
        
  )
}

export default Header
